import React from 'react';
import '../App.css';
import logo from '../logo.svg';

function Nav() {
  return (
    <nav>
      <h3><img src={logo} className="App-logo" alt="logo" /></h3>
      <ul>
          <li>About</li>
          <li>Events</li>
      </ul>
    </nav>
  );
}

export default Nav;
